import React from 'react'
import styles from './Headercss.module.css'
// import Marca from './images/coffe.svg'
// import {ReactComponent as Marca} from './images/coffe.svg';

const Header = () => {
  return (
    <div>
      
      
      <div className={styles.dp_flex}>

      <div className={styles.logo}>
      {/* <img src={Marca} classname={styles.imagem} alt="/"/>
        <h1>teste</h1> */}
      </div>
      <a className={styles.borda} href='/'>Home</a>
      <a className={styles.borda} href='/'>Produtos</a>
      <a className={styles.borda} href='/'>Sobre</a>

      </div>

    </div>
  )
}

export default Header
